                'type' => 'ai_writer',
            'history_data' => '"{\\"request_body\\":{\\"model\\":\\"gpt-4-0125-preview\\",\\"messages\\":[{\\"role\\":\\"system\\",\\"content\\":\\"You are a helpful assistant.\\"},{\\"role\\":\\"user\\",\\"content\\":\\"Generate article about The Impact of AI on E-Commerce: Trends and Insights. Focus on AI, E-Commerce, Impact, Trends, Insights, Online Shopping, Automation, Personalization, Customer Experience, Retail. Maximum 270 words. Creativity is 1 between 0 and 1. Language is  English . Generate 2 different articles. Tone of voice must be Excited\\"}],\\"stream\\":true},\\"response_body\\":\\"### Article 1: Revolutionizing Online Shopping: The AI Magic in E-Commerce!\\\\\\\\n\\\\\\\\n**Hello, E-Commerce Enthusiasts!**\\\\\\\\n\\\\\\\\nDive into the thrilling world of e-commerce, where AI is the new wizard, transforming every pixel of online shopping into a breathtaking experience! Imagine walking into an online store that knows you better than you know yourself - suggesting products you love, deals you can\'t resist, and surprises tailored just for you. That\'s AI, folks - turning every click into a journey of personalized wonder!\\\\\\\\n\\\\\\\\n**The Future is Now! Automation & Personalization Unleashed!**\\\\\\\\n\\\\\\\\nWith automation, AI is redefining convenience, making shopping as easy as blinking! Bots handle queries, transactions are smoother than silk, and inventory management is a dream. Personalization? It\'s on another level - AI is curating shopping experiences bespoke to each shopper\'s desires, leading to jaw-dropping customer loyalty.\\\\\\\\n\\\\\\\\n**Customer Experience: The AI-Powered Nirvana**\\\\\\\\n\\\\\\\\nRetailers, powered by AI, are now gods of customer satisfaction. Imagine, every visit to an online store feels like home, with AI ensuring you find what you need (and what you didn\'t know you needed), making every session a discovery of joy!\\\\\\\\n\\\\\\\\n**Fasten Your Seatbelts: The E-Commerce Evolution Awaits!**\\\\\\\\n\\\\\\\\nAs we rocket into the future, the fusion of AI and e-commerce is only getting stronger, promising a world where shopping online isn\'t just convenient, but a spellbinding experience. E-commerce warriors, the age of AI awaits your exploration, promising realms of possibilities. Let the magic begin!\\\\\\\\n\\\\\\\\n### Article 2: Get Ready to be Wowed: AI\'s Dazzling Impact on E-Commerce!\\\\\\\\n\\\\\\\\n**Hey There, Future-Forward Shoppers!**\\\\\\\\n\\\\\\\\nStep into the spotlight of the e-commerce stage where AI is the star, dazzling us with feats that turn shopping into an exhilarating adventure! Gone are the days of mundane online browsing. Now, it\'s a world where AI brings your desires to your doorstep, in a flourish of personalization and efficiency.\\\\\\\\n\\\\\\\\n**Personalization Like Never Before: Your Wish is AI\\u2019s Command!**\\\\\\\\n\\\\\\\\nAI\'s wizardry means understanding you deeper. Every click, every wish, is noted, leading to a shopping experience that feels like it\'s crafted by a personal genie. From bespoke product recommendations to tailor-made deals, AI makes your shopping desires its command!\\\\\\\\n\\\\\\\\n**Automation: The Silent Hero of Seamless Shopping**\\\\\\\\n\\\\\\\\nBehind the scenes, AI is the dynamo powering a revolution in how we shop. From lightning-fast customer service via chatbots to real-time inventory management, AI is the backbone of a frictionless e-commerce experience, making every moment online a breeze.\\\\\\\\n\\\\\\\\n**The Customer Experience: A Leap into the Future**\\\\\\\\n\\\\\\\\nPrepare for an e-commerce experience so intuitive, it feels like magic. AI ensures that every touchpoint with an online retailer is unforgettable, transforming routine shopping into moments of pure delight. Your digital retail journey, powered by AI, is nothing short of extraordinary.\\\\\\\\n\\\\\\\\n**E-Commerce Reimagined: The AI Era is Here!**\\\\\\\\n\\\\\\\\nAs AI continues to weave its magic across the e-commerce landscape, we\'re not just witnessing a transformation; we\'re part of an exciting journey into a future where technology and creativity merge to redefine what shopping online means. E-commerce aficionados, welcome to the exhilarating realm of endless possibilities with AI!\\\\\\\\n\\\\\\\\n**Let the Adventure Begin!**\\"}"',
