                'user_id' => 3,
                'type' => 'ai_writer',
                'history_data' => '"{\\"request_body\\":{\\"model\\":\\"gpt-4-0125-preview\\",\\"messages\\":[{\\"role\\":\\"system\\",\\"content\\":\\"You are a helpful assistant.\\"},{\\"role\\":\\"user\\",\\"content\\":\\"Generate article about Tech Giants Under Scrutiny: Antitrust Investigations and Regulatory Measures. Focus on Tech giants, antitrust investigations, regulatory measures, Big Tech, monopolistic practices, competition law, digital marketplaces, consumer protection. Maximum 250 words. Creativity is 1 between 0 and 1. Language is  English . Generate 1 different articles. Tone of voice must be Casual\\"}],\\"stream\\":true},\\"response_body\\":\\"Hey there! Let\'s dive into the bustling world of tech giants and the magnifying glass they\'re under. Picture this: Big Tech companies, you know the ones - they practically run the digital universe. But with great power comes great scrutiny. Enter stage left: antitrust investigations and regulatory measures.\\\\\\\\n\\\\\\\\nSo, what\'s the big deal? Well, these tech behemoths stand accused of playing the game a bit too well, dominating the sandbox of digital marketplaces so much that the smaller kids can\'t even build a sandcastle. Whether it\'s gobbling up potential rivals before breakfast or locking in consumers so tight they can\'t see other products, the moves are monopolistic, say regulators.\\\\\\\\n\\\\\\\\nGovernments and competition watchdogs are cracking the whip with antitrust laws designed to promote fair play and protect us, the consumers. From the U.S. to the European Union, the message is clear: balance the scales, or we\'ll balance them for you. These investigations aim to crack open the doors to competition, giving innovators a fair shot and keeping prices and choices healthy for consumers.\\\\\\\\n\\\\\\\\nThe digital realm is a wild west, but with these modern sheriffs in town, there\'s hope yet for taming the unruly giants. As we watch this drama unfold, remember, it\'s all about keeping the digital playground fun and fair for everyone. Who said regulatory measures couldn\'t be exciting?\\"}"',
